function Jsonform(){
  const [id,setId]=useState("")
  const [title,setTitle]=useState("")
  const [company,setCompany]=useState("")
  const [salary,setSalary]=useState("")

  const chnageId=(a)=>{
    setId(a.target.value)
  }
  const chnageTitle=(a)=>{
    setTitle(a.target.value)
  }
  const chnageCompany=(a)=>{
    setCompany(a.target.value)
  }
  const chnageSalary=(a)=>{
    setSalary(a.target.value)
  }
    return(
        <div>
            <form>
  
  <div className="mb-3">
    <label for="exampleInputPassword1" class="form-label">ID</label>
    <input type="password" value={id}   onChange={chnageId} class="form-control" id="exampleInputPassword1"/>
  </div>
  <div className="mb-3">
    <label for="exampleInputPassword1" class="form-label">title</label>
    <input type="password" value={title} onChange={chnageTitle} class="form-control" id="exampleInputPassword1"/>
  </div>
  <div className="mb-3">
    <label for="exampleInputPassword1" class="form-label">Company</label>
    <input type="password" value={company} onChange={chnageCompany} class="form-control" id="exampleInputPassword1"/>
  </div>
  <div className="mb-3">
    <label for="exampleInputPassword1" class="form-label">Salary</label>
    <input type="password" value={salary}  onChange={ chnageSalary}class="form-control" id="exampleInputPassword1"/>
  </div>
  <button type="submit" class="btn btn-primary">Submit</button>
</form>
          
        </div>
    )
}
export default Jsonform;
